    Act_EAST = Activations_EAST.(month_name);
    Act_WEST = Activations_WEST.(month_name);

    % Dimensioni delle matrici correnti
    [~, total_columns] = size(Act_EAST);

    % Concatenazione delle matrici recuperata e consumata alle matrici vuote
    Activations_EAST_conc(:, start_column:start_column+total_columns-1) = Act_EAST;
    Activations_WEST_conc(:, start_column:start_column+total_columns-1) = Act_WEST;

    % Aggiornamento dell'indice di inizio per la prossima iterazione
    start_column = start_column + total_columns;
end

%% GREEN VALVE - AVAILABLE PRESSURE

vector_support_EAST = zeros(size(Pressure_EAST_concatenated, 1), 1);
vector_support_WEST = zeros(size(Pressure_WEST_concatenated, 1), 1);

DP_GV_EAST = zeros(1, size(Pressure_EAST, 2));
DP_GV_WEST = zeros(1, size(Pressure_WEST_concatenated, 2));
P_net_EAST = zeros(size(Pressure_EAST_concatenated));
P_net_WEST = zeros(size(Pressure_WEST_concatenated));

for i = 1 : size(Pressure_EAST_concatenated, 2)
    vector_support_EAST = Pressure_EAST_concatenated(:, i);
    vector_support_WEST = Pressure_WEST_concatenated(:, i);

    % Find in the current time step the minimum value of pressure within
    % the net
    min_EAST = min(vector_support_EAST(vector_support_EAST ~= 0));
    min_WEST = min(vector_support_WEST(vector_support_WEST ~= 0));

    % Find if the minimum exists different from zero, if all the nodes are
    % off in the time instant it creates problem otherwise with the code.
    % If there is a minimum positive pressure in the net the available
    % hydraulic head in the GV is computed subtracting the minimum value at
    % each hydrant (20 m)
    if isempty(min_EAST)
        dp_EAST = 0;
    else
        dp_EAST = min_EAST - P_min;
    end

    if isempty(min_WEST)
        dp_WEST = 0;
    else
        dp_WEST = min_WEST - P_min;
    end

    % Expand dp_EAST to correspond size with Pressure_EAST_concatenated(:, i)
    dp_EAST_rep = repmat(dp_EAST, size(Pressure_EAST_concatenated, 1), 1);
    dp_WEST_rep = repmat(dp_WEST, size(Pressure_WEST_concatenated, 1), 1);

    % Subtract the GV head for each active node in the Net
    P_net_EAST(:, i) = Pressure_EAST_concatenated(:, i) - (vector_support_EAST ~= 0) .* dp_EAST_rep(1:size(Pressure_EAST_concatenated, 1));
    P_net_WEST(:, i) = Pressure_WEST_concatenated(:, i) - (vector_support_WEST ~= 0) .* dp_WEST_rep(1:size(Pressure_WEST_concatenated, 1));
    DP_GV_EAST(1, i) = dp_EAST;
    DP_GV_WEST(1, i) = dp_WEST;
end


%% ENERGY RECOVERY GREENVALVE

Size_GV_EAST = 6; % [inches]
