opening_GV_EAST = zeros(1, length(Q_EAST_GV));
Efficiency_GV_EAST = zeros(1, length(Q_EAST_GV));

for i = 1 : length(Q_EAST_GV)
    % necessary flow coefficient computation
    CV_Necessary_EAST_GV(i) = ((Q_EAST_GV(i)*3.6)/(0.865*((DP_GV_EAST(i)*0.09806)^0.5)));
    % Total available power for the GV
    Pow_available_GV_EAST(i) = (rho*g*(Q_EAST_GV(i)/1000)*(DP_GV_EAST(i)));
    % GV opening derivation from flow coefficient
    opening_GV_EAST(i) = 0.019866185*(CV_Necessary_EAST_GV(i)/(Size_GV_EAST^2)).^4-0.337964376*(CV_Necessary_EAST_GV(i)/(Size_GV_EAST^2)).^3+1.243263993*(CV_Necessary_EAST_GV(i)/(Size_GV_EAST^2)).^2+8.69532324*(CV_Necessary_EAST_GV(i)/(Size_GV_EAST^2))+0.970542041;
    % Opening adjustments
    if opening_GV_EAST(i) > 100
        opening_GV_EAST(i) = 100;
    elseif opening_GV_EAST(i) < 0
        opening_GV_EAST(i) = 0;
    end
    opening_GV_EAST(i) = opening_GV_EAST(i)./100.*(90-brakeAngle)+brakeAngle;
    % Efficiency definition as a function of the opening
    Efficiency_GV_EAST(i) = (-9.18759E-10.*(opening_GV_EAST(i)).^5+ 2.58404E-07.*(opening_GV_EAST(i)).^4-2.54209E-05.*(opening_GV_EAST(i)).^3+0.000972469.*(opening_GV_EAST(i)).^2-0.009785738.*(opening_GV_EAST(i))+0.032159983).*eta_gen;
end

CV_Necessary_WEST_GV = zeros(1, length(Q_WEST_GV));
Pow_available_GV_WEST = zeros(1, length(Q_WEST_GV));
opening_GV_WEST = zeros(1, length(Q_WEST_GV));
Efficiency_GV_WEST = zeros(1, length(Q_WEST_GV));

for i = 1 : length(Q_WEST_GV)
    CV_Necessary_WEST_GV(i) = ((Q_WEST_GV(i)*3.6)/(0.865*((DP_GV_WEST(i)*0.09806)^0.5)));
    Pow_available_GV_WEST(i) = (rho*g*(Q_WEST_GV(i)/1000)*(DP_GV_WEST(i)));
    opening_GV_WEST(i) = 0.019866185*(CV_Necessary_WEST_GV(i)/(Size_GV_WEST^2)).^4-0.337964376*(CV_Necessary_WEST_GV(i)/(Size_GV_WEST^2)).^3+1.243263993*(CV_Necessary_WEST_GV(i)/(Size_GV_WEST^2)).^2+8.69532324*(CV_Necessary_WEST_GV(i)/(Size_GV_WEST^2))+0.970542041;
