%% OASIS: AVAILABLE PRESSURE, POWER AND REQUIRED FLOW COEFFICIENT

% Insert filter for nodes that are never open
% Find rows where at least one element is nonzero
nonzero_rows_EAST = any(P_net_EAST, 2);
nonzero_rows_WEST = any(P_net_WEST, 2);

% Select only non-null rows from the original matrix
P_net_EAST_filt = P_net_EAST(nonzero_rows_EAST, :);
Activations_EAST_filt = Activations_EAST_conc(nonzero_rows_EAST, :);
P_net_WEST_filt = P_net_WEST(nonzero_rows_WEST, :);
Activations_WEST_filt = Activations_WEST_conc(nonzero_rows_WEST, :);

Press_available_EAST = zeros(size(P_net_EAST_filt));
Pow_available_EAST = zeros(size(P_net_EAST_filt));
CV_required_EAST = zeros(size(P_net_EAST_filt));
Press_available_WEST = zeros(size(P_net_WEST_filt));
Pow_available_WEST = zeros(size(P_net_WEST_filt));
CV_required_WEST = zeros(size(P_net_WEST_filt));

% Cycle for each node and each hour in the matrix EAST
for node = 1:size(P_net_EAST_filt, 1)
    for hour = 1:size(P_net_EAST_filt, 2)
        % Check if the node is active
        if Activations_EAST_filt(node, hour) == 1
            % Check if the pressure exceeds the limit
            if P_net_EAST_filt(node, hour) >= P_min
                % Calculate the difference and insert into Press_available_EAST
                Press_available_EAST(node, hour) = P_net_EAST_filt(node, hour) - P_min;
                % Calculate available power and CV at the node
                Pow_available_EAST(node, hour) = (rho*g*(Q/1000)*(Press_available_EAST(node, hour)));
                CV_required_EAST(node, hour) = ((Q*3.6)/(0.865*((Press_available_EAST(node, hour)*0.09806)^0.5)));
            else
                % Insert 0 if the pressure is equal or lower than the
                % minimum value
                Press_available_EAST(node, hour) = 0;
                Pow_available_EAST(node, hour) = 0;
                CV_required_EAST(node, hour) = 0;
            end
        else
            % Insert 0 if the node is not active
            Press_available_EAST(node, hour) = 0;
            Pow_available_EAST(node, hour) = 0;
            CV_required_EAST(node, hour) = 0;
        end
    end
end

% Cycle for each node and each hour in the matrix WEST
for node = 1:size(P_net_WEST_filt, 1)
    for hour = 1:size(P_net_WEST_filt, 2)
        % Check if the node is active
        if Activations_WEST_filt(node, hour) == 1
            % Check if the pressure exceeds the limit
            if P_net_WEST_filt(node, hour) >= P_min
                % Calculate the difference and insert into Press_disp_OVEST
                Press_available_WEST(node, hour) = P_net_WEST_filt(node, hour) - P_min;
                % Calculate available power and CV at the node
                Pow_available_WEST(node, hour) = (rho*g*(Q/1000)*(Press_available_WEST(node, hour)));
                CV_required_WEST(node, hour) = ((Q*3.6)/(0.865*((Press_available_WEST(node, hour)*0.09806)^0.5)));
            else
                % Insert 0 if the pressure does not exceed the limit
                Press_available_WEST(node, hour) = 0;
                Pow_available_WEST(node, hour) = 0;
                CV_required_WEST(node, hour) = 0;
            end
        else
            % Insert 0 if the node is not active
            Press_available_WEST(node, hour) = 0;
            Pow_available_WEST(node, hour) = 0;
            CV_required_WEST(node, hour) = 0;
