OAS_opening_EAST = zeros(size(CV_required_EAST));
OAS_efficiency_EAST = zeros(size(CV_required_EAST));

OAS_opening_WEST = zeros(size(CV_required_WEST));
OAS_efficiency_WEST = zeros(size(CV_required_WEST));

% Calculate the value of opening and efficiency for each element of the
% matrices EAST

% The opening is computed as a function of CV/d^2 not only CV, in this case
% all the sizes are 1 inch, so I didn't add anything in the expressions
% below

for i = 1:size(CV_required_EAST, 1)
    for j = 1:size(CV_required_EAST, 2)
        OAS_opening_EAST(i, j) = 0.00147470153299696*(CV_required_EAST(i, j))^4-0.030736861804376*(CV_required_EAST(i, j))^3-0.182356368565236*(CV_required_EAST(i, j))^2+8.41199017155187*(CV_required_EAST(i, j))-7.73246122232044E-14;
        if OAS_opening_EAST(i, j) > 100
            OAS_opening_EAST(i, j) = 100;
        elseif OAS_opening_EAST(i, j) < 1
            OAS_opening_EAST(i, j) = 0;
        end
    end
end

OAS_opening_EAST(isnan(OAS_opening_EAST)) = 0;

for i = 1:size(CV_required_EAST, 1)
    for j = 1:size(CV_required_EAST,2)
        if OAS_opening_EAST(i, j) == 0;
            OAS_efficiency_EAST(i,j) = 0;
        else
        OAS_efficiency_EAST(i, j) = ((-4.55851424972361E-08*(OAS_opening_EAST(i, j))^5+ 0.0000159240600990777*(OAS_opening_EAST(i, j))^4-0.00179911621964658*(OAS_opening_EAST(i, j))^3+0.066544494219994*(OAS_opening_EAST(i, j))^2+1.55056331925843E-13)/100)*eta_gen;
        end
        if OAS_efficiency_EAST(i,j) < 0.002
            OAS_efficiency_EAST(i,j) = 0;
        end
    end
end

% Calculate the value of opening and efficiency for each element of the matrices WEST
for i = 1:size(CV_required_WEST, 1)
    for j = 1:size(CV_required_WEST, 2)
        OAS_opening_WEST(i, j) = 0.00147470153299696*(CV_required_WEST(i, j))^4-0.030736861804376*(CV_required_WEST(i, j))^3-0.182356368565236*(CV_required_WEST(i, j))^2+8.41199017155187*(CV_required_WEST(i, j))-7.73246122232044E-14;
        if OAS_opening_WEST(i, j) > 100
            OAS_opening_WEST(i, j) = 100;
        elseif OAS_opening_WEST(i, j) < 1
            OAS_opening_WEST(i, j) = 0;
        end
    end
end

OAS_opening_WEST(isnan(OAS_opening_WEST)) = 0;

for i = 1:size(CV_required_WEST, 1)
    for j = 1:size(CV_required_WEST, 2)
        if OAS_opening_WEST(i, j) == 0;
            OAS_efficiency_WEST(i,j) = 0;
        else
        OAS_efficiency_WEST(i, j) = ((-4.55851424972361E-08*(OAS_opening_WEST(i, j))^5+ 0.0000159240600990777*(OAS_opening_WEST(i, j))^4-0.00179911621964658*(OAS_opening_WEST(i, j))^3+0.066544494219994*(OAS_opening_WEST(i, j))^2+1.55056331925843E-13)/100)*eta_gen;
        end
        if OAS_efficiency_WEST(i,j) < 0.002
            OAS_efficiency_WEST(i,j) = 0;
        end
    end
end


%% OASIS: POWER AND ENERGY RECOVERED

