%% Adding consumption related with communication

Pow_communication = 40; % [W]
duration_communication = 10; % [s]
En_communication = Pow_communication * duration_communication/3600; % [Wh]
Communication_consumption = zeros(size(modality_EAST));

% Define occurrence frequency for the different modalities
occurrence_frequency_deepsleep = 10*48; % [half an hour]
occurrence_frequency_active = 10; % [10 times every half an hour, that is every 3 minutes]
occurrence_frequency_standby = 3; % [every 10 minutes]

communication_consumption_EAST = zeros(size(modality_EAST));
communication_cosumption_WEST = zeros(size(modality_WEST));
[num_rows_EAST, num_columns] = size(modality_EAST);
num_rows_WEST = size(modality_WEST, 1);

% Communication consumption for active and standby modality in EAST network
for row = 1:num_rows_EAST
    for column = 1:num_columns
        % Active modality
        if strcmp(modality_EAST{row, column}, 'active')
            communication_consumption_EAST(row, column) = En_communication * occurrence_frequency_active;
            % Standby modality
        elseif strcmp(modality_EAST{row, column}, 'standby')
            communication_consumption_EAST(row, column) = En_communication * occurrence_frequency_standby;
        end
    end
end

% Communication consumption for active and standby modality in WEST network
for row = 1:num_rows_WEST
    for column = 1:num_columns
        % Active Modality
        if strcmp(modality_WEST{row, column}, 'active')
            communication_cosumption_WEST(row, column) = En_communication * occurrence_frequency_active;
            % Standby Modality
        elseif strcmp(modality_WEST{row, column}, 'standby')
            communication_cosumption_WEST(row, column) = En_communication * occurrence_frequency_standby;
        end
    end
end

% Deep_Sleep consumption
indices_deep_sleep = [1, 481, 961, 1441, 1488, 1489, 1969, 2449, 2832, 2833, 3313, 3793, 4320, 4321, 4801, 5281, 5760, 14593, 15073, 15553, 16032, 16033, 16513, 16993, 17473, 17520];

for i = 1 : length(indices_deep_sleep)
    communication_consumption_EAST(:, indices_deep_sleep(i)) = communication_consumption_EAST(:, indices_deep_sleep(i)) + En_communication;
    communication_cosumption_WEST(:, indices_deep_sleep(i)) = communication_cosumption_WEST(:, indices_deep_sleep(i)) + En_communication;
end

% Matrice consumi totali
consumption_EAST = consumption_EAST + communication_consumption_EAST;
consumption_WEST = consumption_WEST + communication_cosumption_WEST;

